import Messager from "./components/Messager";
import MyMenu from "./components/MyMenu";
import { useState, useEffect } from "react";

function App() {

  const [models, setModels] = useState([]);
  const [model, setModel] = useState('');
  useEffect(() => {
    fetch('http://localhost:11434/api/tags')
      .then(response => response.json())
      .then(data => {setModels(data.models); setModel(data.models[1].name)});
  }, []);

  return (
    <div>
      <MyMenu models={models} setModel={setModel}/>
      <div style={{ width: '50%', height: '2%', padding: '10px', backgroundColor: '#f0f0f0', textAlign: 'center', marginBottom: '0px' }}>
        当前模型: {model}  {/* 添加模型名称展示区域 */}
      </div>
      <Messager model={model}/>
    </div>
  );
}

export default App;
